import React from "react";

function Card({ icon, title, children }) {
  return (
    <div className="col s12">
      <div className="header">
        <h3>
          <strong>
            <i className={`fa fa-${icon}`} aria-hidden="true" /> {title}
          </strong>
        </h3>
      </div>
      <div className="body">{children}</div>
    </div>
  );
}

export default Card;
